Eastern Rises By Feltsoulmedia (2009)

A short Film about a fishing expedition to the Kamchatka Peninsula of Russia. Footage includes fishing for rainbow trout and salmon, also includes Sasquatch sightings. 38 Minutes ABOUT THE FILM MAKERS Founded in 2005, high in the Southern Rockies of Colorado, Felt Soul Media combines the vision of Travis Rummel and Ben Knight. Felt Soul unites our passions for wild places, our love of fly fishing, and our conservation ethic. &quot;We create avant-garde style documentaries with an aesthetic approach to capture the inherent beauty of fly fishing and the amazing confines that the sport takes place in. We are passionate about our films and fly fishing.&quot;

For more albums, music videos or films then please contact or comment.
